const Log = (props) => {
    return ( 
    <>
        <div>
                <h3>{props.titulo}</h3>
                <p>{props.descrição}Whatsapp Voltou a operar normalmente</p>
                <p>{props.datalog}Horas atrás</p>
            </div>
    </>
     );
}
 
export default Log;
